import React,{Component} from "react";

class Match extends Component {
    render() {
        let data = this.props.data;
        let toPrint;
        data.map(function (e, i){
            toPrint += <h1>Hello, {e.mn}</h1>;
        });

        return <div>mata</div>;

    }
}

export default Match;
